import axios from "axios";
import React, { useEffect, useState } from "react";

const StockPicks: React.FC = () => {
  const [data, setData] = useState<any[][]>([]);
  const [error, setError] = useState<string | null>(null);

  // Sheet configuration
  const SHEET_ID = "1tRLI64dU83Fcit_YAKfKhvlmfctRp7c5SMA_A7XMTkE";
  const SHEET_NAME = "Sheet1";
  const API_KEY = "AIzaSyAC511tUxujeEh1TkYVejr3HozvJkiaZ-8";

  // Embedded styles
  const styles = {
    container: {
      maxWidth: "1200px",
      margin: "0 auto",
      padding: "2rem",
    },
    title: {
      fontSize: "2rem",
      fontWeight: "bold",
      marginBottom: "1.5rem",
      color: "#111827",
    },
    grid: {
      display: "grid",
      gridTemplateColumns: "repeat(auto-fill, minmax(300px, 1fr))",
      gap: "1.5rem",
    },
    card: {
      backgroundColor: "white",
      borderRadius: "0.5rem",
      border: "1px solid #e5e7eb",
      boxShadow: "0 1px 3px 0 rgb(0 0 0 / 0.1)",
      transition: "box-shadow 0.2s ease",
      overflow: "hidden",
      ":hover": {
        boxShadow: "0 4px 6px -1px rgb(0 0 0 / 0.1)",
      },
    },
    cardHeader: {
      padding: "1.5rem 1.5rem 0.75rem 1.5rem",
    },
    cardContent: {
      padding: "0.75rem 1.5rem 1.5rem 1.5rem",
      borderTop: "1px solid #e5e7eb",
    },
    headerFlex: {
      display: "flex",
      justifyContent: "space-between",
      alignItems: "flex-start",
    },
    stockName: {
      fontSize: "1.5rem",
      fontWeight: "bold",
      color: "#111827",
    },
    companyName: {
      fontSize: "0.875rem",
      color: "#6b7280",
    },
    badge: {
      display: "inline-flex",
      alignItems: "center",
      justifyContent: "center",
      padding: "0.125rem 0.625rem",
      borderRadius: "0.375rem",
      fontSize: "0.875rem",
      fontWeight: "500",
      lineHeight: "1.25rem",
    },
    sectionTitle: {
      fontSize: "0.875rem",
      fontWeight: "500",
      color: "#4b5563",
      marginBottom: "0.25rem",
    },
    value: {
      fontSize: "1.125rem",
      color: "#111827",
    },
    thesis: {
      fontSize: "0.875rem",
      color: "#6b7280",
      lineHeight: "1.25rem",
    },
    metricsList: {
      fontSize: "0.875rem",
      color: "#6b7280",
      listStyleType: "disc",
      paddingLeft: "1rem",
    },
    error: {
      color: "#dc2626",
      padding: "1rem",
      backgroundColor: "#fee2e2",
      borderRadius: "0.375rem",
    },
    loading: {
      textAlign: "center",
      padding: "2rem",
      fontSize: "1.125rem",
      color: "#6b7280",
    },
  } as const;

  // Badge colors for different sectors
  const sectorStyles = {
    Technology: {
      backgroundColor: "#dbeafe",
      color: "#1e40af",
    },
    Healthcare: {
      backgroundColor: "#dcfce7",
      color: "#166534",
    },
    Finance: {
      backgroundColor: "#f3e8ff",
      color: "#6b21a8",
    },
    Consumer: {
      backgroundColor: "#fef9c3",
      color: "#854d0e",
    },
    Energy: {
      backgroundColor: "#fee2e2",
      color: "#991b1b",
    },
    Industrial: {
      backgroundColor: "#f3f4f6",
      color: "#1f2937",
    },
  };

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(
          `https://sheets.googleapis.com/v4/spreadsheets/${SHEET_ID}/values/${SHEET_NAME}?key=${API_KEY}`
        );
        if (response.data && response.data.values) {
          setData(response.data.values.slice(1));
        } else {
          setError("No data received from the API");
        }
      } catch (error) {
        console.error("Error fetching data:", error);
        if (axios.isAxiosError(error)) {
          setError(
            `Error: ${error.response?.status} - ${
              error.response?.data?.error?.message || error.message
            }`
          );
        } else {
          setError("An unexpected error occurred");
        }
      }
    };

    fetchData();
  }, []);

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Jack's Stock Picks</h1>

      {error ? (
        <div style={styles.error}>{error}</div>
      ) : data.length > 0 ? (
        <div style={styles.grid}>
          {data.map((row, index) => (
            <div key={index} style={styles.card}>
              <div style={styles.cardHeader}>
                <div style={styles.headerFlex}>
                  <div>
                    <h2 style={styles.stockName}>{row[0]}</h2>
                    <p style={styles.companyName}>{row[1]}</p>
                  </div>
                  <span
                    style={{
                      ...styles.badge,
                      ...sectorStyles[row[2] as keyof typeof sectorStyles],
                    }}
                  >
                    {row[2]}
                  </span>
                </div>
              </div>
              <div style={styles.cardContent}>
                <div style={{ display: "grid", gap: "1rem" }}>
                  <div>
                    <p style={styles.sectionTitle}>Current Price</p>
                    <p style={styles.value}>${row[3]}</p>
                  </div>
                  <div>
                    <p style={styles.sectionTitle}>Target Price</p>
                    <p style={styles.value}>${row[4]}</p>
                  </div>
                  <div>
                    <p style={styles.sectionTitle}>Investment Thesis</p>
                    <p style={styles.thesis}>{row[5]}</p>
                  </div>
                  <div>
                    <p style={styles.sectionTitle}>Key Metrics</p>
                    <ul style={styles.metricsList}>
                      <li>P/E Ratio: {row[6]}</li>
                      <li>Dividend Yield: {row[7]}%</li>
                      <li>Market Cap: ${row[8]}B</li>
                    </ul>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      ) : (
        <div style={styles.loading}>Loading stock picks...</div>
      )}
    </div>
  );
};

export default StockPicks;
